const webdriver = require('selenium-webdriver');
const { By, until } = webdriver;

async function runAutomation() {
  const driver = new webdriver.Builder()
    .forBrowser('chrome')
    .build();

  try {
    await driver.get('https://www.example.com');

    const element = await driver.wait(until.elementLocated(By.id('myElement')), 5000);
    await element.click();

    // Perform more actions and assertions as needed

    console.log('Automation script executed successfully!');
  } catch (error) {
    console.error('Error occurred during automation:', error);
  } finally {
    await driver.quit();
  }
}

runAutomation();
